import React, { useState } from 'react';
import styled from 'styled-components';

export default function Question({history}) {

    const [r, setR] = useState("");
    const [result, setResult] = useState("");

    function handleClick() {

            history.push({
                pathname: '/result',
                state: { list: result }
            });

    }

    return (
        <div>
            <div> 관심사 태그를 선택해 주세요!</div>
            <QuestionStyled>
                <button onClick={handleClick}>#액티비티</button>
                <button>#쇼핑</button>
                <button>#맛집</button>
                <button>#문호/예술</button>
                <button>#파티</button>
                <button>#자연</button>
                <button>#7</button>
            </QuestionStyled>
        </div>

    )
}

var QuestionStyled = styled.div`

    button {
        width: 100px;
        height: 107px;
        background: #2f3438;
        border-radius: 10px;
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 20px;
        color: #fff;
        font-weight: bold;
        cursor: pointer;
    }
`;
